import React from "react";
import "./Styles/Header.css";
import { ImHome } from "@react-icons/all-files/im/ImHome";

function Header() {
    return (
        <nav className="nav">
            <div className="iconDiv">
                <ImHome size={30} color="black" className="icon" />
                <ImHome size={30} color="black" className="icon" />
                <ImHome size={30} color="black" className="icon" />
            </div>
        </nav>
    );
}

export default Header;
